import { Link } from 'react-router-dom';
import axiosInstance from '../../axios';
import React, { useState, useEffect,  } from 'react';



import Paper from "@material-ui/core/Paper";

import Grid from "@material-ui/core/Grid";


import { styled } from "@mui/material/styles";



import Box from "@mui/material/Box";
import Container from "@mui/material/Container";




import contacts from './flower.json'
const Item = styled(Paper)(({ theme }) => ({
	...theme.typography.body2,
	padding: theme.spacing(1),
	textAlign: "center",
	color: theme.palette.text.secondary
  }));



export default function BasicTable() {

	const result = contacts.filter((v,i) => {
		return contacts.map((val)=> val.Gene).indexOf(v.Gene) == i
	  })

  return (
	<React.Fragment>
    <Container>

        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 4 }}>




          <Grid item xs={2} >
            <Item >
			<Link  style={{textDecoration: 'none'}}><Item style={{backgroundColor:"#ffffff"}} >    <Box sx={{ color: 'secondary.main' }} style={{ wordWrap: "break-word"}}>{result}</Box>	


             </Item></Link>
			</Item>
          </Grid>

        </Grid>

    </Container>
	</React.Fragment>




  );
}
